def transform(sequence):
    last_zero = -1
    last_nonzero = -1
    for i in range(len(sequence)):
        if sequence[i] == 0:
            last_zero = i
        else:
            last_nonzero = i
            break
    if last_nonzero > last_zero:
        sequence[last_zero], sequence[last_zero+1] = sequence[last_zero+1], sequence[last_zero]
    return sequence

